import React from 'react';
import CompSumLi from './CompSumLi';

let arrList = ['1', '2', '3']


const CompSumUl = ({_point, _setPoint}) => {
  return (
    <ul>
      {
        arrList.map((v, idx)=> <CompSumLi  key={v} idx={idx} _point={_point} _setPoint={_setPoint}/>)
      }
    </ul>

  );
};

export default CompSumUl;
